import React from "react";
//border-2 border-black
const StudentSearch = () => {
  return (
    <div className="border-gray-500 h-max w-1/2 ml-2 rounded-lg bg-gray-200">
      <div className=" h-96 flex flex-col ">
        <span className="border-2 border-black text-xl justify-center mb-2 h-10 m-auto mt-1">
          Search Studnet
        </span>
        <div className="flex justify-center">
          <input className="bg-transparent border-2 border-gray-300 rounded-lg w-60 mb-4 mx-4 hover:border-gray-400 px-2"></input>
          <button>Search</button>
        </div>
      </div>
    </div>
  );
};

export default StudentSearch;
